import React from 'react'
import './banner.css'

function Banner() {
  return (
    <div className='banner'>
        <h1>Welcome [username]</h1>
        <h2>It's time to get 'Actsited'...</h2>
        <h3>... with venue hosting made easy!</h3>
        </div>
  )
}

export default Banner
